import React, {Component} from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem
} from 'reactstrap'

class NaviMenu extends Component{
  constructor(props){
      super(props);
      
      this.toggle = this.toggle.bind(this);
      this.state = {
          isOpen:false
      };
  }
    
  toggle(){
    this.setState({
        isOpen: !this.state.isOpen
    });  
  }

  render(){
    return (
      <div className="NaviMenu">
        <Navbar color = "light" light expand ="md">
          <NavbarBrand img = {this.props.gitathonLogo} />
          <NavbarToggler onclick = {this.toggle}/>
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <div className = "GitathonLogo">
                  <ShowLogo logoPath = {this.props.gitathonLogo} name = {"gitathonLogo"}/>
                </div>
              </NavItem>
              <NavItem>
                <div className = "UserName">
                  <Welcome name = {this.props.userName}/>
                </div>
              </NavItem>
              <NavItem>
                <div className = "HackathonLogo">
                  <ShowLogo logoPath = {this.props.hackathonLogo} name = {"hackathonLogo"}/>
                </div>
              </NavItem>
              <NavItem>
                <div className = "profileLogo">
                  <ShowLogo logoPath = {this.props.profileLogo} name = {"profileLogo"} />
                </div>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}

function Welcome({name}){
  return(
    <span className = "Welcoming">
      <font color = "purple">{name} </font> 님 환영합니다!!
    </span>
  )
}

function ShowLogo({logoPath, name}) {
    return(
      <img src = {logoPath} className = {name} alt ={name}/>
    )
}

export default NaviMenu;
